import { Image, Input, useFocusEffect, } from '@chakra-ui/react'
import React, { useEffect } from 'react'
import {FcBiohazard} from "react-icons/fc"
import {FcSearch} from "react-icons/fc"

import {
  Heading,
  Avatar,
  Box,
  Center,
  Text,
  Stack,
  Button,
  Link,
  Badge,
  useColorModeValue,
  Hide,
  Show
} from '@chakra-ui/react';
import "./Farmers.css"
import { useDispatch, useSelector } from 'react-redux'
import { FarmersData } from './FarmerData';
import { FarmersSchemes } from './FarmerSchemes';
import { Get_User } from '../../Redux/AppReducer/action';
export const FarmerPage = () => {
  const UserData=useSelector((state)=>state.Reducer.User?.data);
  const dispatch=useDispatch()
  const User=localStorage.getItem("user").split(",")
  console.log(User,"local");
//   useEffect(()=>{
//     setTimeout(()=>{
//         dispatch(Get_User())
//     },1000)
//   },[dispatch])
  console.log(UserData,"hii");
  return (
    <>
    <Box display={'flex'} >
      <Box >
<Stack direction={'row'} mt={'10'} ml={{base:"5"}}>
    <FcBiohazard fontSize={'40px'}/>
      <Input placeholder='Explore' width={{base:"64",md:'64',lg:'64',xl:'64'}} / > 
        <FcSearch fontSize={'40px'}/>  
</Stack> 
<SocialProfileSimple {...User}/>
</Box>
<Box mt={{base:'48',md:'10',lg:"10",xl:'10'}} ml={{base:'-350px',md:"10",lg:'10',xl:'10'}} style={{height:'100vh',overflowY:"scroll"}} className="imagescroll">
<FarmersData/>
</Box>
<Show above='sm'>
<Box >
  <FarmersSchemes/>
</Box>
</Show>
</Box>
</>
  )
}

 function SocialProfileSimple() {
  return (
    <>
    <Show above='sm'>
    <Center justifyContent={"left"} ml={{base:"5",md:"10",lg:"10",xl:"10"}} mt={'5'}>
      <Box
        maxW={'320px'}
        w={{base:"sm",md:"md",lg:"lg",xl:'xl'}}
        bg={useColorModeValue('white', 'gray.900')}
        boxShadow={{base:"base",md:"md",lg:"lg",xl:'xl'}}
        rounded={'lg'}
        p={6}
        textAlign={'center'}>
        <Avatar
          size={{base:'sm',md:'md',lg:'lg',xl:'xl'}}
          src={
            ' '
          }
          alt={'Avatar Alt'}
          mb={4}
          pos={'relative'}
          _after={{
            content: '""',
            w: 4,
            h: 4,
            bg: 'green.300',
            border: '2px solid white',
            rounded: 'full',
            pos: 'absolute',
            bottom: 0,
            right: 3,
          }}
        />
        <Heading fontSize={{base:'sm',md:'md',lg:'lg',xl:"2xl"}} fontFamily={'body'}>
          Lindsey James
        </Heading>
        <Text fontWeight={600} color={'gray.500'} mb={4}>
          @lindsey_jam3s
        </Text>
        <Text
          textAlign={'center'}
          color={useColorModeValue('gray.700', 'gray.400')}
          px={3}>
          Actress, musician, songwriter and artist. PM for work inquires or{' '}
          <Link href={'#'} color={'blue.400'}>
            #tag
          </Link>{' '}
          me in your posts
        </Text>

        <Stack align={'center'} justify={'center'} direction={'row'} mt={6}>
          <Badge
            px={2}
            py={1}
            bg={useColorModeValue('gray.50', 'gray.800')}
            fontWeight={'400'}>
            #art
          </Badge>
          <Badge
            px={2}
            py={1}
            bg={useColorModeValue('gray.50', 'gray.800')}
            fontWeight={'400'}>
            #photography
          </Badge>
          <Badge
            px={2}
            py={1}
            bg={useColorModeValue('gray.50', 'gray.800')}
            fontWeight={'400'}>
            #music
          </Badge>
        </Stack>

        <Stack mt={8} direction={'row'} spacing={4}>
          <Button
            flex={1}
            fontSize={'sm'}
            rounded={'full'}
            _focus={{
              bg: 'gray.200',
            }}>
            Message
          </Button>
          <Button
            flex={1}
            fontSize={'sm'}
            rounded={'full'}
            bg={'blue.400'}
            color={'white'}
            boxShadow={
              '0px 1px 25px -5px rgb(66 153 225 / 48%), 0 10px 10px -5px rgb(66 153 225 / 43%)'
            }
            _hover={{
              bg: 'blue.500',
            }}
            _focus={{
              bg: 'blue.500',
            }}>
            LogOut
          </Button>
        </Stack>
      </Box>
    </Center>
    </Show>
    <Show breakpoint='(max-width: 470px)'>
      <Stack direction={'row'} justifyContent={"space-around"} mt={'5'}>
        <Text fontSize={'2xl'}>Logo</Text>
        <Image src='https://images.unsplash.com/photo-1520810627419-35e362c5dc07?ixlib=rb-1.2.1&q=80&fm=jpg&crop=faces&fit=crop&h=200&w=200&ixid=eyJhcHBfaWQiOjE3Nzg0fQ' borderRadius={'50%'} width={'16'}></Image>
      </Stack>
</Show>
    </>
  );
}
